// Dashboard.js

import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';
import './Dashboard.css'; // Import your CSS file for Dashboard styles

const Dashboard = () => {
  const [showProductivity, setShowProductivity] = useState(false);
  const history = useHistory();

  const toggleProductivity = () => {
    setShowProductivity(!showProductivity);
  };

  const navigateToWorkerPage = () => {
    // Replace '/worker' with the path to the worker page
    history.push('/worker');
  };

  return (
    <div className="dashboard-container">
      <img src="/logo2.png" alt="Logo" className="main-logo" />
      <img src="/logo3.png" alt="Secondary Logo" className="secondary-logo" />
      <h2 onClick={toggleProductivity} className="dashboard-heading">Employee Productivity Dashboard</h2>
      {showProductivity && (
        <div className="productivity-data">
          <p>Monday: 80%</p>
          <p>Tuesday: 75%</p>
          <p>Wednesday: 85%</p>
          <p>Thursday: 90%</p>
          <p>Friday: 85%</p>
          <p>Saturday: 70%</p>
        </div>
      )}
      <div className="bottom-buttons">
        <button className="home-button">Home</button>
        <button className="worker-button" onClick={navigateToWorkerPage}>Worker</button>
      </div>
    </div>
  );
}

export default Dashboard;
